import java.util.Vector;

public class Main {
    public static void main(String[] args) {
        Vector<Integer> vector = new Vector<>();

        vector.add(0); // Initial elements
        vector.add(1);
        vector.add(2);

        int seed = (int) (Math.random() * 1000);
        int index = seed % 3; // Index will always be between 0 and 2
        int misleadingValue = vector.get(index); // Accessing but not affecting the target

        /* Conditional logic influencing write point */
        if (misleadingValue >= 0) {
            vector.set(2, 10); // Misleading modification
        }

        /* write */ vector.set(1, 42); // Actual write point that affects the read

        vector.add(index, misleadingValue + 5); // More operations not affecting the read

        if (index != 1) {
            vector.remove(0); 
        }

        /* read */ int ret = vector.get(1); // Read point

        System.out.println("Retrieved: " + ret);
    }
}
